import { html } from 'lit-html'
import { variablesCSS, themeCSS } from '../src/theme'

export const parameters = {
  actions: { argTypesRegex: '^on[A-Z].*' },
  decorators: [
    (Story, context) => {
      const variables = variablesCSS
        .toString()
        .replaceAll(':host', '.storybook-wrapper')
      const theme = themeCSS
        .toString()
        .replaceAll(/(?::host)\(([a-z=\[\]-]+)\)/g, '.storybook-wrapper$1')

      return html`<style>
          ${variables}
          ${theme}
        </style>
        <div class="storybook-wrapper" mode="${context.globals.theme}">
          ${Story()}
        </div>`
    },
  ],
  globalTypes: {
    theme: {
      description: 'Global theme for components',
      defaultValue: 'light',
      toolbar: {
        title: 'Theme',
        icon: 'circlehollow',
        items: ['light', 'dark'],
        dynamicTitle: true,
      },
    },
  },
  parameters: {
    backgrounds: {
      default: 'light',
      values: [
        {
          name: 'light',
          value: '#efefef',
        },
        {
          name: 'dashboard',
          value:
            'url(data:image/jpeg;base64,)',
        },
        {
          name: 'stripes',
          value:
            'repeating-linear-gradient(-45deg,transparent 0 20px, black 20px 40px)',
        },
        {
          name: 'dark-blue',
          value: '#213890',
        },
        {
          name: 'dark-grey',
          value: '#424245',
        },
        {
          name: 'black',
          value: '#000000',
        },
        {
          name: 'white',
          value: '#ffffff',
        },
      ],
    },
  },
  controls: {
    matchers: {
      color: /(background|color)$/i,
      date: /Date$/,
    },
  },
}

export default parameters
